import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
    OwpDateTimePicker,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0803001 from '../../include/Pop_C0803001';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'설비명(Tag No.)'}
                                
                            />
                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="Location"
                                options={[
                                    { label: '제조소', value: '1' },
                                    { label: '제조소', value: '2' },
                                ]}
                                value={'1'}
                            />
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'요청번호'}
                                
                            />
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'작업명'}
                                
                            />
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm03'}
                                name={'sm03'}
                                label={'요청자'}
                                
                            />
                            <OwpDateTimePicker
                                initNow
                                label="요청일"
                                inputProps={{ style: { width: 150 } }}
                            />
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="작업요청서">
                            <Pop_C0803001/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            수정
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            삭제
                            </OwpButton>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0806001"
                                LayoutUrl={'/assets/data/C0806001Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
